package com.servinglynk.hmis.warehouse.core.model;import com.fasterxml.jackson.annotation.JsonRootName;@JsonRootName("developerCompanyAccount")public class DeveloperCompanyAccount extends ClientModel {	private Account account;	private String role;	private Boolean owner;		public Account getAccount() {		return account;	}	public void setAccount(Account account) {		this.account = account;	}	public String getRole() {		return role;	}	public void setRole(String role) {		this.role = role;	}	public Boolean isOwner() {		return owner;	}	public void setOwner(Boolean owner) {		this.owner = owner;	}}